<?php
$css=str_replace('//static.miraheze.org/genwiki/0/03/','',base64_decode(""));

/*Compress HTML*/
function xtrim($html){
	return trim(preg_replace('/\s+/', ' ', $html));
}

/*Curl connetion*/
function curl_conn($url){
	global $token;
	
	$curl=curl_init($url);
	curl_setopt($curl, CURLOPT_USERAGENT, $_SERVER['HTTP_USER_AGENT']);
	curl_setopt($curl, CURLOPT_RETURNTRANSFER, true);
	curl_setopt($curl, CURLOPT_FOLLOWLOCATION, true);
	curl_setopt($curl, CURLOPT_SSL_VERIFYPEER, false);
	$html=curl_exec($curl);
	curl_close($curl);

	return $html;
}

/*Read All Pages*/
$html=curl_conn("https://gen.miraheze.org/wiki/Special:AllPages");

/*Parse urls*/
preg_match_all("/<li><a href=\"(.*?)\"/", $html, $matches); $urls=$matches[1];

foreach($urls as $url){
	$filename=str_replace("/wiki/","",$url);
	
	/*Read page*/
	$html=xtrim(str_replace('https://gen.miraheze.org/w/','',curl_conn("https://gen.miraheze.org$url")));
	
	/*Fix images*/
	preg_match_all("/<img(.*?)src=\"(.*?)\"/", $html, $matches); $images=$matches[2];
	foreach($images as $image){
		$l=explode("/", $image);
		$local_image=$l[count($l)-1];
		$html=str_replace($image, $local_image, $html);
	}
	
	/*Remove scripts*/
	preg_match_all("/<script(.*?)<\/script>/", $html, $matches); $scripts=$matches[0];
	foreach($scripts as $script){
		$html=str_replace($script, '', $html);
	}
	
	/*Add css*/
	$html=str_replace("</head>", "$css</head>", $html);	
	
	$fp=fopen("michal/$filename.html", "w");
	fwrite($fp, $html);
	fclose($fp);
}
?>